import React, {useState} from "react";
import {Link} from "react-router-dom";

const SignUp = () => {
    const [email, setEmail] = useState('');
    const [pass, setPass] = useState('');
    const [name, setName] = useState('');

    const handleSubmit = (e: { preventDefault: () => void; }) => {
        e.preventDefault();
        console.log(email);
    }

    return (
        <main className='signup-page'>
            <div className='signup-page__form-wrapper'>
                <h2>Welcome to RPC!</h2>
                <h4>Create your account and start saving time today!</h4>
                <form className="signup-form" onSubmit={handleSubmit}>
                    <label htmlFor="name">Full name</label>
                    <input value={name} name="name" onChange={(e) => setName(e.target.value)} id="name"
                           placeholder="Full Name"/>
                    <label htmlFor="email">Email</label>
                    <input value={email} onChange={(e) => setEmail(e.target.value)} type="email"
                           placeholder="Email" id="email" name="email"/>
                    <label htmlFor="password">password</label>
                    <input value={pass} onChange={(e) => setPass(e.target.value)} type="password" placeholder="Password"
                           id="password" name="password" required={true}/>
                    <button type="submit">Sign Up</button>
                </form>
                <Link to="/">Already have an account? Sign in. </Link>
            </div>
        </main>
    )
}

export default SignUp;
